import defaultProfile from './assets/defaultProfile.png'

const Navbar = () => {
  return (
    <nav style={styles.navbar}>
     <img src='https://media.istockphoto.com/id/1495088043/vector/user-profile-icon-avatar-or-person-icon-profile-picture-portrait-symbol-default-portrait.jpg?s=612x612&w=0&k=20&c=dhV2p1JwmloBTOaGAtaA3AW1KSnjsdMt7-U_3EZElZ0=' alt="Description" style={{ width: '40px', height: '40px'}}/>

      <ul style={styles.links}>
        <li style={styles.link}><a href="/">Home</a></li>
        <li style={styles.link}><a href="/about">About</a></li>
        <li style={styles.link}><a href="/services">Services</a></li>
        <li style={styles.link}><a href="/contact">Contact</a></li>
      </ul>
    </nav>
  );
};

const styles = {
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '10px 20px',
    backgroundColor: '#333',
    color: '#fff',
  },
  logo: {
    fontSize: '20px',
    fontWeight: 'bold',
  },
  links: {
    listStyle: 'none',
    display: 'flex',
    margin: 0,
    padding: 0,
  },
  link: {
    marginLeft: '20px',
  },
};

export default Navbar;
